import React from "react";
import styled from "styled-components";

const Main = styled.main`
  width: 870px;
`;
const AsideSectionWrapper = styled.div`
  display: flex;
`;

const MainComponent = () => {
  return <Main></Main>;
};

export default MainComponent;
